        getVendors();

    }, []);

    console.log(vendors);
    return (
    <Fragment>
  <table className="table mt-5 text-center">
    <thead>
      <tr>
        <th>Company Name</th>
        <th>Application_URL</th>
        <th>Edit</th>
        <th>Delete</th>
      </tr>
    </thead>
